    for word in word_list:
        word = ''.join((e for e in word.lower() if e.isalnum()))
        if len(s) != len(word):
            continue
        s_freq = {}
        for char in s:
            s_freq[char] = s_freq.get(char, 0) + 1
        word_freq = {}
        for char in word:
            word_freq[char] = word_freq.get(char, 0) + 1
        if s_freq == word_freq:
            return True
    return True

